package com.tianyi.bph.web.cache;

public class SessionContains {
	
	public  static final SessionContains instance=new SessionContains();
	
	private SessionContains(){
		
	}
	
	public SessionContains getInstance(){
		return instance;
	}
	
	private String expandeds;
	private String organId;
	private String organPath;
	public String getExpandeds() {
		return expandeds;
	}
	public void setExpandeds(String expandeds) {
		this.expandeds = expandeds;
	}
	public String getOrganId() {
		return organId;
	}
	public void setOrganId(String organId) {
		this.organId = organId;
	}
	public String getOrganPath() {
		return organPath;
	}
	public void setOrganPath(String organPath) {
		this.organPath = organPath;
	}
}
